class Solution(object):
    def lengthOfLongestSubstringTooSlow(self, s):
        """
        :type s: str
        :rtype: int
        """
        if len(s) == 0:
            return 0
        longest = 0
        count = 1
        letterList = {s[0]}
        lastFix = 1
        ct = 1
        while ct < len(s):
            letter = s[ct]
            if letter in letterList:
                if count > longest:
                    longest = count
                count = 0
                letterList = {s[lastFix]}
                lastFix += 1
                ct = lastFix
            else:
                letterList.add(letter)
                ct += 1
            count += 1        
        if count > longest:
            longest = count
            
        if longest > len(s) - ct:
            return longest
        return longest
        
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        # The previous solution lengthOfLongestSubstringTooSlow is too slow for very large inputs.
        # It tracks back to the letter after the previous attempt and repeats work.  Since we used a
        # set on a fixed string, we can remove from the set all letters on the string until the repeated
        # string.  We can then continue along the string without repetition.
        
        if len(s) == 0:
            return 0
        longest = 0
        letterList = {s[0]}
        lastFix = 0
        ct = 1
        while ct < len(s):
            letter = s[ct]
            if letter in letterList:
                if len(letterList) > longest:
                    longest = len(letterList)
                for ct2 in range(lastFix, ct):
                    letterList.remove(s[ct2])
                    if letter == s[ct2]:
                        break
                letterList.add(letter)
                lastFix = ct2 + 1
                ct = ct + 1
            else:
                letterList.add(letter)
                ct += 1
        
        if len(letterList) > longest:
            longest = len(letterList)
        return longest
        
